import React, { useState, useEffect, useRef } from "react";
import Footer from "../footer/footer";
import Navbar from "../Navbar/navbar";
import "./inicio.css";
import { Link } from "react-router-dom";
import {
  obtenerProyectos,
  obtenerProyectosXCategoria,
  obtenerTags,
  obtenerTitulos,
} from "../../firebaseConfig";
import { Button } from "antd";
import {
  ImageListItem,
  ImageListItemBar,
  IconButton,
  ImageList,
  Typography,
  Box,
  ButtonBase,
  TextField,
  Autocomplete,
} from "@mui/material";
import InfoIcon from "@mui/icons-material/Info";
import banner from "../../img/banners/6.png";
import banner2 from "../../img/banners/7.png";
import banner3 from "../../img/banners/8.png";
import banner4 from "../../img/banners/9.png";
import { Carousel } from "react-bootstrap";
import { styled } from "@mui/material/styles";

function Inicio() {
  const [proyectos, setProyectos] = useState([]);
  const [Categoria, setCategoria] = useState(0);
  const [search, setSearch] = useState("");
  const myContainer = useRef(null);
  const [opciones, setOpciones] = useState([]);
  let c = 0;

  useEffect(() => {
    Proyectos(0);
    obtenerTags().then((result) => {
      obtenerTitulos().then((res) => {
        removeDuplicates(res.concat(result));
      });
    });
  }, []);

  function removeDuplicates(inArray) {
    var arr = inArray.concat();
    for (var i = 0; i < arr.length; ++i) {
      for (var j = i + 1; j < arr.length; ++j) {
        if (arr[i] === arr[j]) {
          arr.splice(j, 1);
        }
      }
    }
    setOpciones(arr);
    return arr;
  }

  function Proyectos(index) {
    if (index === 0) {
      obtenerProyectos().then((res) => {
        setProyectos(res);
      });
    } else {
      obtenerProyectosXCategoria(index).then((res) => {
        setProyectos(res);
      });
    }
  }

  function Categorias() {
    const categorias = [
      {
        value: 1,
        label: "Arte Tradicional",
      },
      {
        value: 2,
        label: "Dibujos y Pinturas",
      },
      {
        value: 3,
        label: "Fotografia",
      },
      {
        value: 4,
        label: "Arte digital",
      },
      {
        value: 5,
        label: "3D",
      },
      {
        value: 6,
        label: "Esculturas",
      },

      {
        value: 7,
        label: "Arte callejero",
      },
    ];
    const [busqueda, setBusqueda] = useState("");

    const Buscar = () => {
      setSearch(busqueda);
      setBusqueda("");
    };

    return (
      <div className="col-12 form form-inline mb-3" ref={myContainer}>
        <div className="form form-inline mb-3 mt-2">
          {Categoria === 0 ? (
            <Button type="primary" shape="round" size={"medium"}>
              Todos
            </Button>
          ) : (
            <Button
              shape="round"
              size={"medium"}
              onClick={(e) => {
                setCategoria(0);
                setSearch("");
                Proyectos(0);
              }}
            >
              Todos
            </Button>
          )}
          {categorias.map((categoria) => {
            return (
              <div key={categoria.value}>
                {Categoria === categoria.value ? (
                  <Button type="primary" shape="round" size={"medium"}>
                    {categoria.label}
                  </Button>
                ) : (
                  <Button
                    shape="round"
                    size={"medium"}
                    onClick={(e) => {
                      setCategoria(categoria.value);
                      setSearch("");
                      Proyectos(categoria.value);
                    }}
                  >
                    {categoria.label}
                  </Button>
                )}
              </div>
            );
          })}
        </div>
        <div className="input-group search-input">
          <Autocomplete
            className="mb-3 auto"
            id="size-small-standard"
            size="small"
            options={opciones}
            getOptionLabel={(option) => option}
            onChange={(event, newValue) => {
              setSearch(newValue);
            }}
            renderInput={(params) => (
              <TextField
                {...params}
                label="Buscar..."
                placeholder="Buscar por tÃ­tulo o tag..."
                className="busqueda"
              />
            )}
          />
          <Button type="primary" onClick={Buscar} size="large">
            <img
              alt=""
              src="https://img.icons8.com/ios-glyphs/30/ffffff/broom.png"
            />
          </Button>
        </div>
      </div>
    );
  }

  function Mayuscula(array) {
    let tags = array;
    for (let i = 0; i < array.length; i++) {
      tags[i] = tags[i].toUpperCase();
    }
    return tags;
  }

  function FuntionResize() {
    if (myContainer.current) {
      var widthBrowser = myContainer.current.offsetWidth;
      if (widthBrowser < 524) return 1;
      else if (widthBrowser < 1024) return 2;
      else return 4;
    } else return 3;
  }

  function ButtonBases() {
    const images = [
      {
        url: "data:image/jpeg;base64,",
        title: "Todos",
        width: "12.5%",
      },
      {
        url: "data:image/jpeg;base64,",
        title: "Arte Tradicional",
        width: "12.5%",
      },
      {
        url: "https://es.creativiu.com/wp-content/uploads/2016/07/dibujos-a-lpaiz.jpg",
        title: "Dibujos y Pintura",
        width: "12.5%",
      },
      {
        url: "data:image/jpeg;base64,",
        title: "FotografÃ­a",
        width: "12.5%",
      },
      {
        url: "data:image/jpeg;base64,",
        title: "Arte Digital",
        width: "12.5%",
      },
      {
        url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT7ckRFmkPv6iPu5BPqXSneDaoLP4mBu94Rsw&usqp=CAU",
        title: "3D",
        width: "12.5%",
      },
      {
        url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTRKoH3At-aTaZEZGcd9UmGOpRBa67AkOZ-dw&usqp=CAU",
        title: "Escultura",
        width: "12.5%",
      },
      {
        url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQFNbNqMNqu-svSnbFsVkucda9cBNFzj7I4Qg&usqp=CAU",
        title: "Arte Callejero",
        width: "12.5%",
      },
    ];

    const ImageButton = styled(ButtonBase)(({ theme }) => ({
      position: "relative",
      height: 180,
      [theme.breakpoints.down("sm")]: {
        width: "100% !important", // Overrides inline-style
        height: 100,
      },
      "&:hover, &.Mui-focusVisible": {
        zIndex: 1,
        "& .MuiImageBackdrop-root": {
          opacity: 0.15,
        },
        "& .MuiImageMarked-root": {
          opacity: 0,
        },
        "& .MuiTypography-root": {
          border: "4px solid currentColor",
        },
      },
    }));

    const ImageSrc = styled("span")({
      position: "absolute",
      left: 0,
      right: 0,
      top: 0,
      bottom: 0,
      backgroundSize: "cover",
      backgroundPosition: "center 40%",
    });

    const Image = styled("span")(({ theme }) => ({
      position: "absolute",
      left: 0,
      right: 0,
      top: 0,
      bottom: 0,
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      color: theme.palette.common.white,
    }));

    const ImageBackdrop = styled("span")(({ theme }) => ({
      position: "absolute",
      left: 0,
      right: 0,
      top: 0,
      bottom: 0,
      backgroundColor: theme.palette.common.black,
      opacity: 0.5,
      transition: theme.transitions.create("opacity"),
    }));

    const ImageMarked = styled("span")(({ theme }) => ({
      height: 3,
      width: 18,
      backgroundColor: theme.palette.common.white,
      position: "absolute",
      bottom: -2,
      left: "calc(50% - 9px)",
      transition: theme.transitions.create("opacity"),
    }));

    return (
      <Box
        className="my-4"
        sx={{ display: "flex", flexWrap: "wrap", minWidth: 300, width: "100%" }}
      >
        {images.map((image) => (
          <ImageButton
            focusRipple
            key={image.title}
            style={{
              width: image.width,
            }}
          >
            <ImageSrc style={{ backgroundImage: `url(${image.url})` }} />
            <ImageBackdrop className="MuiImageBackdrop-root" />
            <Image>
              <Typography
                component="span"
                variant="subtitle1"
                color="inherit"
                sx={{
                  position: "relative",
                  p: 4,
                  pt: 2,
                  pb: (theme) => `calc(${theme.spacing(1)} + 6px)`,
                }}
              >
                {image.title}
                <ImageMarked className="MuiImageMarked-root" />
              </Typography>
            </Image>
          </ImageButton>
        ))}
      </Box>
    );
  }

  function CarouselBanner() {
    const [index, setIndex] = useState(0);

    const handleSelect = (selectedIndex, e) => {
      setIndex(selectedIndex);
    };

    return (
      <Carousel
        fade
        controls={false}
        activeIndex={index}
        onSelect={handleSelect}
        className="banner mt-3"
      >
        <Carousel.Item interval={7000}>
          <img
            src={banner}
            alt=""
            className="img-fluid banner"
            style={{ maxHeight: "340px" }}
          />
        </Carousel.Item>
        <Carousel.Item interval={7000}>
          <img
            src={banner2}
            alt=""
            className="img-fluid banner"
            style={{ maxHeight: "340px" }}
          />
        </Carousel.Item>
        <Carousel.Item interval={7000}>
          <img
            src={banner3}
            alt=""
            className="img-fluid banner"
            style={{ maxHeight: "340px" }}
          />
        </Carousel.Item>
        <Carousel.Item interval={7000}>
          <img
            src={banner4}
            alt=""
            className="img-fluid banner"
            style={{ maxHeight: "340px" }}
          />
        </Carousel.Item>
      </Carousel>
    );
  }

  return (
    <div className="inicio">
      <Navbar></Navbar>
      <CarouselBanner></CarouselBanner>
      <div className="container-fluid px-5 my-3">
        <div className="row">
          <Categorias></Categorias>
        </div>
        <div>
          {proyectos.length === 0 ? (
            <div className="alert alert-secondary" role="alert">
              No se encontrÃ³ ningÃºn proyecto de esta <strong>CategorÃ­a</strong>
            </div>
          ) : (
            <div
              className="list"
              style={{
                maxWidth: "100%",
              }}
            >
              <ImageList variant="masonry" cols={FuntionResize()} gap={8}>
                {proyectos.map((proyecto, index) => {
                  if (search === "")
                    return (
                      <ImageListItem className="proyecto" key={index}>
                        <div className="portfolio-item portfolio-item--eff1">
                          <img
                            loading="lazy"
                            src={`${proyecto.datos.img_url}?w=248&fit=crop&auto=format`}
                            srcSet={`${proyecto.datos.img_url}?w=248&fit=crop&auto=format&dpr=2 2x`}
                            alt=""
                            className="img-fluid inicio-foto my-1"
                          />
                          <div className="portfolio-item__info">
                            <h3 className="portfolio-item__header">
                              {proyecto.datos.titulo}
                            </h3>
                            <div className="portfolio-item__links">
                              <div className="portfolio-item__link-block">
                              <Link className="portfolio-item__link" to={"/project/" + proyecto.id}>
                                <a
                                  className="portfolio-item__link"
                                  href="/"
                                  title="Ver Proyecto"
                                >
                                  <i className="material-icons">link</i>
                                </a>
                                </Link>
                              </div>
                            </div>
                          </div>
                        </div>
                        <ImageListItemBar
                          title={proyecto.datos.titulo}
                          className="mb-1 bar"
                          style={{ borderRadius: "0 0 8px 8px" }}
                        />
                      </ImageListItem>
                    );
                  else if (
                    proyecto.datos.titulo.toUpperCase() ===
                      search.toUpperCase() ||
                    Mayuscula(proyecto.datos.tags).includes(
                      search.toUpperCase()
                    )
                  )
                    return (
                      <ImageListItem className="proyecto" key={index}>
                        <div className="portfolio-item portfolio-item--eff1">
                          <img
                            loading="lazy"
                            src={`${proyecto.datos.img_url}?w=248&fit=crop&auto=format`}
                            srcSet={`${proyecto.datos.img_url}?w=248&fit=crop&auto=format&dpr=2 2x`}
                            alt=""
                            className="img-fluid inicio-foto my-1"
                          />
                          <div className="portfolio-item__info">
                            <h3 className="portfolio-item__header">
                              {proyecto.datos.titulo}
                            </h3>
                            <div className="portfolio-item__links">
                              <div className="portfolio-item__link-block">
                              <Link to={"/project/" + proyecto.id}>
                                <a
                                  className="portfolio-item__link"
                                  href="/"
                                  title="Ver Proyecto"
                                >
                                  <i className="material-icons">link</i>
                                </a>
                                </Link>
                              </div>
                            </div>
                          </div>
                        </div>
                        <ImageListItemBar
                          title={proyecto.datos.titulo}
                          className="mb-1 bar"
                          style={{ borderRadius: "0 0 8px 8px" }}
                        />
                      </ImageListItem>
                    );
                  else c++;
                  return (
                    <div key={index}>
                      {c === proyectos.length ? (
                        <div className="row">
                          <div className="col-lg-12">
                            <div
                              className="alert alert-secondary"
                              role="alert"
                              style={{ heigth: "100%" }}
                            >
                              No se encontrÃ³ ningÃºn proyecto que coincida con la
                              bÃºsqueda en esta categorÃ­a
                            </div>
                          </div>
                        </div>
                      ) : (
                        <div></div>
                      )}
                    </div>
                  );
                })}
              </ImageList>
            </div>
          )}
        </div>
      </div>
      <Footer></Footer>
    </div>
  );
}

export default Inicio;
